//routers---it is used connect one component to another component
//dependency--npm i react-router-dom
import "./Router.css"
import Home from "./home";
import About from "./about";
import Contact from "./contact"
function Lap(){
    return(
        <div>
            <ul>
                <li>home</li>
                <li>about</li>
                <li>contact</li>
                <li>service</li>
            </ul>
        </div>
    )
}
export default Lap;
